import React from 'react';
import './styles/Home.css'

export const Home = () => {
    return (
      <main>
        <h1>Home</h1>
        <h2>Sorry, this page is currently under construction.</h2>
        <p>We'll finish it as quickly as we can. Thanks!</p>

        <div className='SoteriaHomeall'>

            <header className='SoteriaHeader'> 

                <div className='SoteriaLeftHeaderCollumn'>
                    <Link className='SoteriaHome' to = '/' >  
                        <img src={logo} className="Soterialogo" alt="logo" />
                    </Link> 
                </div> {/* End App-LeftHeaderCollumn Div */}

                <div className='SoteriaRightHeaderCollumn'> 
                    Edit Credentials
                </div> {/* End App-RightHeaderCollumn Div */}

            </header> {/* End SoteriaHeader */}
  
        </div>
      </main>

      
    );
  };
